import './App.css';
import './styles/styles.css';
import Header from './components/Header/Header';
import Main from './components/Main/Main';
import Footer from './components/Footer/Footer';
import NewTopic from './components/NewTopic/NewTopic';



function App() {
  return (
    <div className="App">

      <Header />
      <Main />
      <Footer />

      <NewTopic />

      
    </div>
  );
}

export default App;
